package poligon.algorithms.strings;

import org.junit.Test;

import static org.junit.Assert.*;
import static poligon.algorithms.strings.WeightedUniformStrings.weightedUniformStrings;

public class WeightedUniformStringsTest {

    @Test
    public void shouldDetermineIfQueryBelongsToUniformStrings() {
        String s = "abccddde";
        int[] queries = {1, 3, 12, 5, 9, 10};

        String[] expected = {"Yes", "Yes", "Yes", "Yes", "No", "No"};

        String[] answers = weightedUniformStrings(s, queries);

        assertArrayEquals(expected, answers);
    }

    @Test
    public void shouldDetermine() {
        String[] expected = {"Yes", "No"};

        String[] answers = weightedUniformStrings(testData, new int[]{45580, 271944});

        assertArrayEquals(expected, answers);
    }

    private final String testData =
            "";
}